import type { AssetType } from "./AssetType";
import type { TransferApiType } from "./TransferApiType";
export type CreateAssetRequest = {
    /**
     * Asset type.
     */
    asset_type: AssetType;
    /**
     * Data specific to the asset type; use the class named ${asset_type}Data
     */
    data: Record<string, any>;
    /**
     * Asset descriptions.
     */
    description: string | null;
    /**
     * True if asset is public.
     */
    is_public?: boolean;
    /**
     * Asset name.
     */
    name: string;
    /**
     * Transfer API type.
     */
    transfer_api_type?: TransferApiType;
    /**
     * Upload the contents of the url as the asset.
     */
    url?: string | null;
};
